import React from 'react'
import Navbar from '../components/navbar'
import { Row, Col } from 'react-grid-system'

class Misc extends React.Component{
    render(){
        return(
            <div>
                <Navbar />
                <Row>
                    <Col md={5}>
                    <img src={require('../images/misc/Gazette.jpg')} alt='Gazette'/>
                    </Col>
                    <Col md={5}>
                    <img src={require('../images/misc/Gazette.jpg')} alt='Gazette'/>
                    </Col>
                </Row>

            </div>
        );
    }
}

export default Misc
